this["JST"]["application"] = Handlebars.template({"compiler":[6,">= 2.0.0-beta.1"],"main":function(depth0,helpers,partials,data) {
    return "<h1 class=\"name\">Megan Dunbar</h1>\n\n<div class=\"titles\">\n  <h3 class=\"first-title\">junior front-end developer</h3>\n  <h3 class=\"second-title\">freelance writer</h3>\n</div>\n\n<div class=\"body-text\">\n  <p class=\"par1\">\n    I’m a graduate of <a target=\"_blank\" href=\"http://theironyard.com/locations/greenville/\">The Iron Yard’s Greenville, SC campus</a>,\n  </p>\n    <p class=\"par2\">\n      where I learned to build <a target=\"_blank\" href=\"http://mldunbar.github.io/2.2-responsive/sushi.html\">responsive</a>, <a target=\"_blank\" href=\"http://mldunbar.github.io/8.1-bookmarks/\">interactive</a>, <a target=\"_blank\" href=\"http://mldunbar.github.io/bicycle-app-2/\">fully-functional</a> web apps\n    </p>\n    <p class=\"par3\">\n      with JavaScript using tools such as <a target=\"_blank\" href=\"#\">Handlebars</a>, Bourbon, and Neat,\n    </p>\n    <p class=\"par2\">\n      add-ons like jQuery and underscore; all within Ember.js and Backbone.js frameworks.\n    </p>\n  <p class=\"par1\">\n    I have a familiarity with Gulp, Bower, and Node.\n  </p>\n  <p class=\"par2\">\n    I’ve also worked extensively with Parse as a back-end server.\n  </p>\n  <p class=\"par3\">\n    Before this, I worked as a line cook at a <a href=\"http://swamprabbitcafe.com/\">grocery store</a> that supports local farmers.\n  </p>\n  <p class=\"par2\">\n    I also lived in Vietnam for a while, working in an multicultural office\n  </p>\n  <p class=\"par1\">\n    and traveling a part of the globe I’d never seen before. I hiked across Spain once.\n  </p>\n  <p class=\"par2\">\n    I’m a graduate of Louisiana State University with a degree in English and a strong focus on journalism.\n  </p>\n  <p class=\"par3\">\n    When I’m not in front of my computer playing with new programming languages,\n  </p>\n  <p class=\"par2\">\n    you can find me keeping up a blog, hiking, and trying to play guitar.\n  </p>\n</div>\n";
},"useData":true});